import { useParams } from "react-router-dom";

export default function OtherUserPage(){
    const params = useParams()
    useEffect(()=>{
        fetch(`http://localhost:3000/books${params.id}`)
        .then(response => response.json())
        .then(data=>console.log(data))  
    },[])
}
